import React from 'react'
import './StatPanel.css'

function StatPanel({stat, title, content}) {
    return (
        <main className='stat-panel'>
            <section style={{
                display: 'flex',
                flexDirection: 'row',
                alignItems: 'center',
                justifyContent: 'flex-start',
                gap: '15px',
                textAlign: 'left',
            }}>
                <h2>
                    { stat }
                </h2>
                <h3 style={{color: 'var(--text-color)'}}>
                    { title }
                </h3>
            </section>
            <h3>
                { content }
            </h3>
        </main>
    );
}

export default StatPanel;
